import{_ as e,o as t,c as a,O as i}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 46.2-736.2 Special license plates for certain elected or appointed officials.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/46.2-736.2.md","filePath":"vacode/46.2-736.2.md"}'),o={name:"vacode/46.2-736.2.md"},r=i('<h1 id="§-46-2-736-2-special-license-plates-for-certain-elected-or-appointed-officials" tabindex="-1">§ 46.2-736.2 Special license plates for certain elected or appointed officials. <a class="header-anchor" href="#§-46-2-736-2-special-license-plates-for-certain-elected-or-appointed-officials" aria-label="Permalink to &quot;§ 46.2-736.2 Special license plates for certain elected or appointed officials.&quot;">​</a></h1><p>The Commissioner, on application, shall issue to honorary consuls, upon receipt of written evidence from the United States Department of State that the applicant is an honorary consul on active status, and members of county boards of supervisors, city councils, town councils, state commissions and boards and to other state officials appointed by the Governor special license plates bearing decals or stickers bearing the legend &quot;HONORARY CONSUL&quot; or identifying the commission, board, or office to which the applicant has been elected or appointed.</p><p>For the purposes of subdivision B 2 of § <a href="http://law.lis.virginia.gov/vacode/46.2-725/" target="_blank" rel="noreferrer">46.2-725</a>, the total number of active plates issued under this section shall be used to determine whether the plates authorized under this section shall continue to be issued.</p><p>1995, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?951+ful+CHAP0747" target="_blank" rel="noreferrer">747</a>; 1996, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?961+ful+CHAP1026" target="_blank" rel="noreferrer">1026</a>; 2003, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?031+ful+CHAP0921" target="_blank" rel="noreferrer">921</a>; 2004, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?041+ful+CHAP0747" target="_blank" rel="noreferrer">747</a>.</p>',4),n=[r];function s(c,l,p,d,f,h){return t(),a("div",null,n)}const g=e(o,[["render",s]]);export{u as __pageData,g as default};
